@Анатолий Залесский нет, про папирус только и будем говорить. 
Ты видимо не знаешь, но папирус , это специальный материал который использовали в древности для передачи и сохранения информации в виде записанного на нем текста. То есть по папирусы нельзя ни чего увидеть. Так как сам материал объективно не является носителем смысла. Но вот из папируса можно извлечь информацию и по этой информации можно составить некое субъективное видение, благодаря внимательному осмыслению содержания текста. То есть если ты хотел сумничать, то тебе следовало было писать ,- не по вашим папирусам, а из ваших папирусов. Но и это будет тоже безграмотно , так как ,я уже писал, что из материала извлечь информацию не реально. Информацию извлекают из текста, а не из материального носителя. А, арт если бы ты написал ( ну, понятно ты хотел показать какой ты грамотей) , то тебе следовало было использовать другие слова. Например: " эссе" или " очерк" , но для остроты лучше конечно " эпос" .  Ну, типа поглумится над неграмотным. Но вот не задача; ты в очередной раз обделался, потому как сам того не желая, показал абсолютное невежество. ( я надеюсь смысл слова " невежда" тебе понятен) 
Только не пукни, и не скройся. Помогай тебе Бог! Ну, а, если тебе не понятно , о чем я говорю. То попробуй слово " папирус" заменить на слово " бумага".

@MOON 5 ой, да ладно. Фигни. Ну как давай поговорим. По-моему вы идиот или идиотка. Что такое Храм Божий?! Жду ответа.  Потому как вы явно не в теме вообще. Вот Исаакиевский Собор , это Храм Божий или нет? Или, это тоже гундяевский домик. Насчёт религий, да , есть монотеиз и есть ряд верований в основе которых лежит пантеизм или анимизм и много ещё чего. Но я говорил о язычестве как примитивном суеверии и кстати об этом писал. Я вам написал что вы язычник и суевер. Если у вас нет религиозных воззрений, но имеете веру , то вы есть язычник в самом грубом смысле этого слова. Дремучий демонопоклонник. Потому как язычество в своём первобытном состоянии ,- это и есть поклонение демоническим силам. Вы не назвали себя ни христианином ни кем либо ещё и при этом сказали что вы не религиозный человек. Вывод: вы дремучий, первобытный демонопоклонник. И не зря вас так раздражают православные Храмы. И пишите по существу. И насчёт сект,- скорее всего сектант это как раз ты. При том очень серьёзный сектант с сатанинской направленностью.
Кстати я вас спросил какой ваш выбор, мой выбор Христос!
Я думаю, что скорее всего вы увлечены грубой оккультной эзотерикой.  Кстати, все духовный практики ( на самом деле, это обычный оккультизм) находят своё основание именно в язычестве, то есть в демонопоклонстве.  Судя по всему вы практикуете бесообщение.

@MOON 5 нет, вы не знаток, это точно. И что значит гундяевские домики? Это значит что вы не признание Церковь вообще. А человек в не Церкви но верующий, и при этом не религиозен, то он язычник. Потому как Церковь, она не гундяевская и не чья либо ещё, она Христова. Вы этого не признание, значит вы язычник, вы ведь сами сказали что не религиозный человек. То есть не принадлежите  к какой либо иной конфессии. Мусульманин скажет, сто его религия ислам, буддист скажет, что его религия буддизм. А вы что про себя сказать можете?! Вы и сказали,- верующий, но не религиозный, следовательно,- вы язычники суевер. 
Насчёт, ада,- вот вы и подтвердили , для вас важность этого слова. ))))
Да, у каждого свой выбор, и мой выбор Христос. А ваш?!

