@Irina Gvozdeva А почему собственно люди должны верить в богов по вашему? И какому нужно из сотен и тысяч других? Религий сейчас сотни, не считая тех, которые перешли в мифы и сказки. Почему вера в Иисуса Христа должна быть самой правильной?
Осточертел цирк, строящийся вокруг православия. Если бы я думал, как вы, то счёл бы посланниками дьявола нынешних верховных служителей, включая Кирилла. Исковеркали веру превратив её в поклонение предметам и остаткам трупов. А любая свобода мысли подавляется страхом перед попаданием в Ад и растерзанием толпой. Где предполагается отречься от всего мирского, что уже противоречит естеству, но сами служители при этом чуть ли не педофилией занимаются (некоторые уже попадались). Про шикарные машины и хоромы тех же служителей можно не упоминать - хотя это тоже мирское. Где можно замолить любой грех, лишь бы денег хватило.
Не нужно мне такое.

